function NavElements() {
  return (
    <>
      <h3> ABOUT </h3>
      <h3> CONTACT </h3>
      <h3> CAFE` </h3>
    </>
  );
}

export default function NavAll() {
  return (
    <>
      <img src="logo.png" alt="LOGO" />
      <NavElements />
      <img src="heart.png" alt="HEART" />
      <img src="menu.png" alt="MENU" />
    </>
  );
}
